async function qualifications() {
  const qualification = getQualification();
  let template = "";
  for (let index = 0; index < Object.keys(qualification).length; index++) {
    const qua = Object.keys(qualification)[index];
    template += `<tr>
					<td  style="height: 40px;" colspan="7">${qua}</td>
				</tr>`;
    let child = "";
    for (let index = 0; index < qualification[qua].length; index++) {
      const single = qualification[qua][index];
      child += `<tr>
						<td>${single.factor}</td>
						<td>${stripHtmlAttributes(single.requirement)}</td>
						<td>${single.singleEntityCondition.value}</td>
						<td>${single.jvCominedCondition.value}</td>
						<td>${single.jvEachPartherCondition.value}</td>
						<td>${single.jvAtleastOnePartnerCondition.value}</td>
						<td>${single.formLink}</td>
				</tr>
        ${
          single.note
            ? `<tr>
                <td class="note" colspan="7">
                 ${await stripHtmlAttributes(`<div>${single.note}</div>`)}
                </td>
              </tr>`
            : ""
        }
         
        `;
    }
    template += child;
  }
  // console.log(template);

  // console.log(data);
  return template;
}
async function technicalScoring() {
  const parentTechnicalScoring = getTechnicalScoring().find(
    (scoring) => scoring.parentId === "00000000-0000-0000-0000-000000000000"
  );
  const scorings = getTechnicalScoring().filter(
    (scoring) => scoring.parentId === parentTechnicalScoring.id
  );
  let template = "";

  let child = "";
  for (let index = 0; index < scorings.length; index++) {
    const single = scorings[index];
    child += `<tr>
						<td>${index + 1}</td>
						<td>${single.requirement[0].condition}
            ${
              getTechnicalScoring().filter(
                (scoring) => scoring.parentId === single.id
              ).length === 0
                ? ""
                : childScoring(
                    getTechnicalScoring().filter(
                      (scoring) => scoring.parentId === single.id
                    )
                  )
            }
            </td>
						<td>${single.point}</td>
				</tr>
        `;
  }
  template += child;

  // console.log(template);

  // console.log(data);
  return template;
}
