function childScoring(children) {
  let template = "";

  let child = "";
  for (let index = 0; index < children.length; index++) {
    const single = children[index];
    child += `
      <table class="subtable">
      			<tbody class="cell-sub">
      <tr>
						<td>${index + 1}</td>
						<td>${single.requirement[0].condition}
            ${
              getTechnicalScoring().filter(
                (scoring) => scoring.parentId === single.id
              ).length === 0
                ? ""
                : childScoring(
                    getTechnicalScoring().filter(
                      (scoring) => scoring.parentId === single.id
                    )
                  )
            }
            </td>
						<td>${single.point}</td>
				</tr>
			</tbody>
		</table>
        `;
  }
  template += child;
  return template;
}
async function bidDataSheet() {
  const bds = getBds();
  let template = "";
  for (let index = 0; index < Object.keys(bds).length; index++) {
    const bdsCategory = Object.keys(bds)[index];
    template += `<tr>
					<td  style="height: 40px;" colspan="7">${bdsCategory}</td>
				</tr>`;
    let child = "";
    for (let index = 0; index < bds[bdsCategory].length; index++) {
      const single = bds[bdsCategory][index];
      child += `<tr>
						<td>${single.itbReference}</td>
						<td>${single.description}: ${single.value.values}</td>
				</tr>`;
    }
    template += child;
  }
  // console.log(template);

  // console.log(data);
  return template;
}
