      note: '<p>Note:<br></p><p><span style="color: rgb(51, 51, 51); font-family: &quot;Helvetica Neue&quot;; font-size: 13px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: 400; letter-spacing: normal; orphans: 2; text-align: start; text-indent: 0px; text-transform: none; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; white-space: normal; background-color: rgb(255, 255, 255); text-decoration-thickness: initial; text-decoration-style: initial; text-decoration-color: initial; display: inline !important; float: none;"><span>&nbsp;</span></span><span style="color: rgb(51, 51, 51); font-family: &quot;Helvetica Neue&quot;; font-size: 13px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: 400; letter-spacing: normal; orphans: 2; text-align: start; text-indent: 0px; text-transform: none; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; white-space: normal; background-color: rgb(255, 255, 255); text-decoration-thickness: initial; text-decoration-style: initial; text-decoration-color: initial; display: inline !important; float: none;">​</span><span style="box-sizing: border-box; border: 0px solid rgb(226, 232, 240); -webkit-user-drag: none; overflow: visible; font-family: Candara, &quot;sans-serif&quot;; font-size: 13px; color: rgb(51, 51, 51); display: inline; vertical-align: baseline; margin: 0px; padding: 0px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: 400; letter-spacing: normal; orphans: 2; text-align: start; text-indent: 0px; text-transform: none; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; white-space: normal; background-color: rgb(255, 255, 255); text-decoration-thickness: initial; text-decoration-style: initial; text-decoration-color: initial;"><span style="box-sizing: border-box; border: 0px solid rgb(226, 232, 240); -webkit-user-drag: none; overflow: visible; font-family: inherit; font-size: inherit; color: inherit; display: inline; vertical-align: baseline; margin: 0px; padding: 0px;">•<span style="box-sizing: border-box; border: 0px solid rgb(226, 232, 240); -webkit-user-drag: none; overflow: visible; font: 7pt &quot;Times New Roman&quot;; color: inherit; display: inline; vertical-align: baseline; margin: 0px; padding: 0px;">&nbsp;</span></span></span>During Evaluation, the Average Annual Construction Turnover of a Joint Venture(JV) bidder’s “All Parties Combined” shall be determined as follows: <!--[if !supportLists]-->​</p><p><span style="font-family:&quot;Candara&quot;,&quot;sans-serif&quot;; mso-fareast-font-family:Candara;mso-bidi-font-family:Candara;mso-fareast-language: EN-US"><span style="mso-list:Ignore">•<span style="font:7.0pt &quot;Times New Roman&quot;">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></span></span><!--[endif]-->​<span style="mso-fareast-language:EN-US">If </span>bidders<span style="mso-fareast-language:EN-US"> submit their bid in Joint Venture (JV), the construction turnover requirement for each partner (members of the JV) shall not be less than 25%; while for the lead partner of the JV shall not be less than 40%.”</span><!--[if !supportLists]-->​<span style="font-family:&quot;Candara&quot;,&quot;sans-serif&quot;; mso-fareast-font-family:Candara;mso-bidi-font-family:Candara"><span style="mso-list:Ignore">•<span style="font:7.0pt &quot;Times New Roman&quot;">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></span></span><!--[endif]-->​First, Each JV Partner’s ACT for the respective year will be “summed up” to obtain the Total ACT of “All Parties Combined” for each year of the last five years;<!--[if !supportLists]-->​</p><p><span style="font-family:&quot;Candara&quot;,&quot;sans-serif&quot;; mso-fareast-font-family:Candara;mso-bidi-font-family:Candara"><span style="mso-list:Ignore">•<span style="font:7.0pt &quot;Times New Roman&quot;">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></span></span><!--[endif]-->​Then, the average of each Year’s Total ACTs of “All Parties Combined” (in the last 5 years) will be taken for the evaluation.<!--[if !supportLists]-->​</p><p><span style="font-family:&quot;Candara&quot;,&quot;sans-serif&quot;; mso-fareast-font-family:Candara;mso-bidi-font-family:Candara"><span style="mso-list:Ignore">•<span style="font:7.0pt &quot;Times New Roman&quot;">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></span></span><!--[endif]-->​The value of total certified payments received in each year (i.e. ACTs) shall be adjusted for inflation of Birr value through multiplying by Cn/Co factor, where Cn is value of 1 US Dollar in Birr on the date 28 days prior to bid submission date and Co is the value of 1 US Dollar in Birr computed using the exchange rate prevailing on the last date of the respective fiscal year.</p><p><!--[if !supportLists]-->​<span style="font-family:&quot;Candara&quot;,&quot;sans-serif&quot;; mso-fareast-font-family:Candara;mso-bidi-font-family:Candara"><span style="mso-list:Ignore">•<span style="font:7.0pt &quot;Times New Roman&quot;">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></span></span><!--[endif]-->​The basis of computing US Dollar value of Birr shall be the selling exchange rate issued by the National Bank of Ethiopia.<!--[if !supportLists]-->​</p><p><span style="font-family:&quot;Candara&quot;,&quot;sans-serif&quot;; mso-fareast-font-family:Candara;mso-bidi-font-family:Candara"><span style="mso-list:Ignore">•<span style="font:7.0pt &quot;Times New Roman&quot;">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></span></span><!--[endif]-->For foreign bidders, while converting Annual Construction Turnover (ACT) indicated in other currencies to equivalent amount in ETB, the applicable exchange rate should be the selling exchange rate of National Bank of Ethiopia for the date ending of each Fiscal Year.<span style="font-size:11.0pt;font-family: &quot;Times New Roman&quot;,&quot;serif&quot;;mso-fareast-font-family:&quot;Times New Roman&quot;;mso-ansi-language: EN-US;mso-fareast-language:FR;mso-bidi-language:AR-SA">.<span style="mso-tab-count:1">&nbsp;&nbsp;&nbsp;&nbsp;</span></span></p><p><span style="font-size:12.0pt;font-family:&quot;Times New Roman&quot;,&quot;serif&quot;; mso-fareast-font-family:&quot;Times New Roman&quot;;mso-ansi-language:EN-US;mso-fareast-language: EN-US;mso-bidi-language:AR-SA">If a bidder is awarded and /or recommended for award of any two works contracts by ERA Six months prior to the bid submission date of the subject projects and until the award of the subject projects, the qualification criteria for the construction turnover will be the aggregate of the criteria of the subject projects; and that of the awarded contracts and/or those recommended to be awarded.&nbsp;</span></p><p><span style="font-size:12.0pt;font-family:&quot;Times New Roman&quot;,&quot;serif&quot;; mso-fareast-font-family:&quot;Times New Roman&quot;;mso-ansi-language:EN-US;mso-fareast-language: EN-US;mso-bidi-language:AR-SA">Documentary evidences of Audited Financial Statements, General &amp; Specific Experiences, Article of Association and the other relevant company establishment documents as well as the power of attorney of the firm that are emanated outside the country of the Employer shall be notarized by the authorized body and authenticated by the Ethiopian Ministry of Foreign Affair.</span></p>',
