      order: 47,
      value: {
        values:
          "<p>Advance payment granted to the contractor, at his request and upon submission of the required advance payment security.<br></p>",
      },
      prefix: null,
      mandate: "PE",
      category: "PaymentTerms",
      readOnly: true,
