          "The Contractor, Sub-Contractors, and their Personnel :\n(i)\t1  Shall not be exempted from duties and indirect taxes levied by the Federal Democratic Republic of Ethiopia. \nThe Public Body warrants that the Contractor, the Sub- Contractors and the Personnel shall be exempt from (or that the Public Body shall pay on behalf of the Contractor, the Sub- Contractors and the Personnel, or shall reimburse the Contractor, the Sub- Contractors and the Personnel for) any indirect taxes, duties, fees, levies and other impositions imposed, under the Applicable Law, on the Contractor, the Sub- Contractor s and the Personnel in respect of:\n(a).\tany payments whatsoever made to the Contractor, Sub- Contractors and the Personnel (other than nationals or permanent residents of the Federal Democratic Republic of Ethiopia), in connection with the carrying out of the works;\n(b).\tany equipment, materials and supplies brought into the Federal Democratic Republic of Ethiopia by the Contractor or Sub- Contractors for the purpose of carrying out the Services and which, after having been brought into such territories, will be subsequently withdrawn there from by them;\n(c).\tany equipment imported for the purpose of carrying out the works and paid for out of funds provided by the Public Body and which is treated as property of the Public Body;\n(d).\tany property brought into the Federal Democratic Republic of Ethiopia by the Contractor, any Sub- Contractors or the Personnel (other than nationals or permanent residents of the Federal Democratic Republic of Ethiopia), or the eligible dependents of such Personnel for their personal use and which will subsequently be withdrawn there from by them upon their respective departure from the Federal Democratic Republic of Ethiopia, provided that:\n(i)\tthe Contractor, Sub- Contractors and Personnel, or their eligible dependents, shall follow the usual customs procedures of the Federal Democratic Republic of Ethiopia in importing property into the Federal Democratic Republic of Ethiopia; and\n(ii)\tif the Contractor, Sub- Contractors or Personnel, or their eligible dependents, do not withdraw but dispose of any property in the Federal Democratic Republic of Ethiopia upon which customs duties and taxes have been exempted, the Contractor, Sub- Contractors or Personnel, as the case may be, (i) shall bear such customs duties and taxes in conformity with the regulations of the Federal Democratic Republic of Ethiopia, or (ii) shall reimburse them to the Public Body if they were paid by the Public Body at the time the property in question was brought into the Federal Democratic Republic of Ethiopia\n",
